import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, IconButton } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import SubscriptionsIcon from '@mui/icons-material/Subscriptions';
import PersonIcon from '@mui/icons-material/Person';
import LoginIcon from '@mui/icons-material/Login';
import AddIcCallIcon from '@mui/icons-material/AddIcCall';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import SearchIcon from '@mui/icons-material/Search';
import AddShoppingCartIcon from '@mui/icons-material/AddShoppingCart';

import './Navbar.css';
import './App.css';
import SalesPage from './pages/SalesPage';
import MensWearPage from './pages/MensWearPage';
import WomensWearPage from './pages/WomensWearPage';
import ImageSlider from './Slider';
import ContactPage from './pages/ContactPage';
import CompleteView from './CompleteView';
import Login from './Login';
import DisplayPage from './DisplayPage';
import SignUpPage from './SignUpPage';
import ProductUpload from './ProductUpload';
import ProductDetail from './ProductDetail';
import Checkout from './Checkout';
import CartItem from './CartItem';

const App = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [isActive, setIsActive] = useState(false);

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);
  const handleSearch = () => setIsActive(!isActive);

  return (
    <Router>
      <nav className="navbar">
        {/* Logo */}

        {/* Desktop View */}
        <div className="nav-desktop">
        <div className="logo" style={{ marginTop: '-5px' }}>
          WENALI!
        </div>

          <ul className="nav-links">
            <li><Link to="/ContactPage">Contact</Link></li>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/MensWearPage">MensWear</Link></li>
            <li><Link to="/WomensWearPage">WomensWear</Link></li>
            <li><Link to="/SalesPage">Sales</Link></li>
          </ul>

          <ul className="nav-icons">
            <li>
              <input
                type="text"
                className="s"
                placeholder="Search Product"
                style={{
                  marginBottom: '10px',
                  padding: '15px',
                  height: '10px',
                  width: '400px',
                  marginTop: '-10px',
                  borderRadius: '120px',
                  backgroundColor: 'rgb(212,214,218)',
                  outline: 'none',
                  border: 'none'
                }}
              />
            </li>

            <li>
              <Link to="/Login"><PersonIcon style={{ color: 'black' }} /></Link>
            </li>

            <li>
              <AddShoppingCartIcon />
            </li>
          </ul>
        </div>




















        {/* Mobile View */}
        <div className="nav-mobile" style={{display:'flex',justifyContent:'center'}}>
          {!isActive && (
            <li style={{listStyleType:'none',fontSize:'30px'}}>WENALI !</li>
          )}

          <div className="rightside" style={{textAlign:'right',marginLeft:'',backgroundColor:'',width:'400px'}}>

          {isActive && (
            <input
              className={`search-input ${isActive ? 'active' : ''}`}
              placeholder="Search..."
              style={{
                paddingLeft: '15px',
                height: '20px',
                padding: '5px',
                backgroundColor: 'rgb(212,214,218)',
                borderRadius: '12px',
                border: 'none',
                outline: 'none',
                transition: 'width 0.4s ease'
              }}
            />
          )}

          <IconButton className="more-button" onClick={handleSearch} style={{marginRight:''}}>
            <SearchIcon className="search-icon" />
          </IconButton>

          <IconButton className="more-button" onClick={toggleSidebar}>
            <MoreHorizIcon />
          </IconButton>
          </div>

          <Drawer
            anchor="left"
            open={sidebarOpen}
            onClose={toggleSidebar}
            variant="temporary"
            sx={{
              '& .MuiDrawer-paper': {
                width: 250,
                boxSizing: 'border-box',
              },
